import React from 'react';

const RaceSelector = () => {
  return (
    <div>
      <label>
        Race:
        <select>
          {/* Add options for different races */}
          <option value="human">Human</option>
          <option value="elf">Elf</option>
          <option value="dwarf">Dwarf</option>
          {/* Add more races as needed */}
        </select>
      </label>
    </div>
  );
}

export default RaceSelector;
